import {Fragment} from "react"
import {useSelector} from "react-redux"
import {useParams} from "react-router-dom"
const UpdateEntry = () => {
    const entries = useSelector(state => state.entries)

    const params = useParams()
    const {id} = params
    const entry = entries.find(data => data._id == id)
    console.log(entry)

    return (
        <Fragment>
            <label>Title</label>
            <p contentEditable="true">{entry.title}</p>
            <label>Topic</label>
            <p contentEditable="true">{entry.topic}</p>
            <label>Entry</label>
            <p contentEditable="true">{entry.entry}</p>
            <button className="btn">Save</button>
            <button className="btn">Cancel</button>
        </Fragment>
    )
}
export default UpdateEntry
